import { useState, useEffect } from 'react'
import reactLogo from './assets/react.svg'
import viteLogo from '/vite.svg'
import './App.css'

function App() {
    const [responseData, setResponseData] = useState(null);
	
    const handleClick = () => {
		// Data you want to send with the POST request
		const postData = {
		Base64Key: {base64ImageArray}
		,imageCount:{count}
		};
		
		   fetch("https://7f26uyyjs5.execute-api.us-east-2.amazonaws.com/ListEasily/ListEasilyAPI", {
      method: "POST",
      //headers: {
        "Content-Type": "application/json", // Content-Type for JSON data
      //},
      body: JSON.stringify(postData), // Convert object to JSON string
    })
      .then((response) => response.json()) // Parse the JSON response
      .then((data) => {
        setResponseData(data); // Set response data in state
        console.log(data);
      })
      .catch((error) => console.error("Error CALLING API:", error));
	};

  const [filesBase64, setFilesBase64] = useState([]);

  const handleFileChange = async (event) => {
    const files = Array.from(event.target.files); // Convert FileList to array
    const base64List = await Promise.all(
      files.map(file => convertToBase64(file))
    );
    setFilesBase64(base64List);
  };

  const convertToBase64 = (file) => {
    return new Promise((resolve, reject) => {
      const reader = new FileReader();
      reader.readAsDataURL(file);
      reader.onload = () => resolve(reader.result.split(',')[1]);
      reader.onerror = (err) => reject(err);
    });
  };


  return (
    <>
      <div>
        <img src="data:image/jpeg;base64," alt="ListEasier Image" class="logoCSS" />
      </div>
	  
      <div className="card">
	  
    <div>
      <input type="file" multiple accept="image/*" onChange={handleFileChange} />
      <div style={{ display: 'flex', gap: '1rem', flexWrap: 'wrap', marginTop: '1rem' }}>
        {filesBase64.map((src, index) => (
          <img key={index} src={src} alt={`preview ${index}`} style={{ width: 100 }} />
        ))}
      </div>
	  
	  <div style={{ display: 'flex', gap: '1rem', flexWrap: 'wrap', marginTop: '1rem' }}>
        {filesBase64.map((src, index) => (
          <p>{src.split(',')[1]}</p>
        ))}
      </div>
    </div>
	
<br></br>
        <button onClick={handleClick}>
          Generate Listing
        </button>
		 {<pre>{JSON.stringify(responseData, null, 2)}</pre>}
      </div>

    </>
  )
}

export default App
